import React from "react";
import {BrowserRouter as Router, Route, Swithch} from "react-router-dom";

import Books from "./pages/Books";
import Nav from "./components/Nav";

function App() {
  return (
    <div>
      <Nav />
      <Switch>
        <Route exact path="/" component={Books} />
      </Switch>
      <Books />
    </div>
  );
}

export default App;
